/**
            * All input variables needs to be passed as function param;
            * Objects received as param needs to be parsed. Ex.: JSON.parse(inputVariable1);
            * Objects returned needs to be stringfied. Ex.: JSON.stringify(inputVariable1);
            **/
            function run(response) {

                var obejectResponse = {
                    avatarUrl1 : JSON.parse(response)[0].owner.avatar_url,
                    fullName1 : JSON.parse(response)[0].full_name,
                    description1 : JSON.parse(response)[0].description,
                    avatarUrl2 : JSON.parse(response)[1].owner.avatar_url,
                    fullName2 : JSON.parse(response)[1].full_name,
                    description2 : JSON.parse(response)[1].description,
                    avatarUrl3 : JSON.parse(response)[2].owner.avatar_url,
                    fullName3 : JSON.parse(response)[2].full_name,
                    description3 : JSON.parse(response)[2].description,
                    avatarUrl4 : JSON.parse(response)[3].owner.avatar_url,
                    fullName4 : JSON.parse(response)[3].full_name,
                    description4 : JSON.parse(response)[3].description,
                    avatarUrl5 : JSON.parse(response)[4].owner.avatar_url,
                    fullName5 : JSON.parse(response)[4].full_name,
                    description5 : JSON.parse(response)[4].description
                }

                return obejectResponse; //Return value will be saved as "Return value variable" field name
            }
